import logo from './logo.svg';
import './App.css';
import Square from './shapes/Square';
import Circle from './shapes/Circle';
import Cone from './shapes/Cone';




function App() {
  return (
    <div >
      <Square value={10} />
      <Circle value={20} />
      <Cone value={30} />
    </div>
  );
}

export default App;
